import React, { Component } from 'react'
import './index.css'

export default class Header extends Component {
  render() {

    handleAddItem = (event) => {
      console.log(event.target)
    }

    return (
      <div className="todo-header">
        <input type="text" onkeyUp="handleAddItem" placeholder="请输入你的任务名称，按回车键确认"/>
      </div>
    )
  }
}
